import { useState } from 'react';
import './App.css';

function ToDoList() {

    const [items, setItems] = useState();
    const[itemList, setItemList] = useState([]);

    const listitems = (event)=>{
      setItems(event.target.value);          
    }

    const showitemList = ()=>{
        setItemList((items_arr)=>{

           return [...itemList, items];

        })         
    }





    return(        
       <>
        <div className='tolist_main_div'>
            <div className='tolist_center_div'>
                <h1>To Do List</h1>
                <input type='text' placeholder='Add your items' onChange={listitems}  />
                <button onClick={showitemList}>+</button>
                <ul>
                    {/* <li>{items}</li> */}
                    itemList.map((itemslistvalue)={
                        <li>{itemslistvalue}</li>
                    })
                </ul>
            </div>
        </div>
       </>
    )

}

export default ToDoList;
